query healthcheck {
    healthcheck
}

query levels {
    levels {
        id
        subject {
            id
            name
            description
            dateFrom
            dateTo
            active
            __typename
        }
        name
        dateFrom
        dateTo
        active
        description
        __typename
    }
}

query level ($id: Int!) {
    level (id: $id) {
        id
        subject {
            id
            name
            description
            dateFrom
            dateTo
            active
            __typename
        }
        name
        dateFrom
        dateTo
        active
        description
        __typename
    }
}

query subjects {
    subjects {
        id
        name
        description
        dateFrom
        dateTo
        active
        __typename
    }
}

query IntrospectionQuery {
      __schema {
        queryType {
          name
    }
    mutationType {
          name
    }
    subscriptionType {
          name
    }
    types {
          ...FullType
    }
    directives {
          name
      description
      locations
      args {
            ...InputValue
      }
    }
  }
}

fragment FullType on __Type {
      kind
  name
  description
  fields(includeDeprecated: true) {
        name
    description
    args {
          ...InputValue
    }
    type {
          ...TypeRef
    }
    isDeprecated
    deprecationReason
  }
  inputFields {
        ...InputValue
  }
  interfaces {
        ...TypeRef
  }
  enumValues(includeDeprecated: true) {
        name
    description
    isDeprecated
    deprecationReason
  }
  possibleTypes {
        ...TypeRef
  }
}

fragment InputValue on __InputValue {
      name
  description
  type {
        ...TypeRef
  }
  defaultValue
}

fragment TypeRef on __Type {
      kind
  name
  ofType {
        kind
    name
    ofType {
          kind
      name
      ofType {
            kind
        name
        ofType {
              kind
          name
          ofType {
                kind
            name
            ofType {
                  kind
              name
              ofType {
                    kind
                name
              }
            }
          }
        }
      }
    }
  }
}
